@jonathantheweirdo

What I heard in the video however could be seamlessly interpreted as : if you work for someone who spends their time (labor) managing, you're being exploited as the person who hired you *also* needs to make 'profit' in this co-op. I also don't see how this is exploitation, but what I pointed out was that according to what was said, all parties have legitimate claim on the total added value from the co-op by stating that they themselves added the totality of that value. All you need to add to see the picture I'm painting is that in the example given, have one person hire the other. Suddenly, the added value according to the video's depiction of marxism should all rightfully go to the one who is hired else it's exploitation.

