Game theory eh? I see you're a man of culture as well. I'm *inclined* to agree, though I was hoping to get an answer from Mr PhilTube on how Marxism addresses this issue since he's pushing it really hard on this channel and I'm pretty confident he has an answer in mind that I might have missed. Dude's a smart dude. :D
